import React from "react";
import {projects} from "../data.js"


export default function Projects() {
  const projects = [
    {
      title: "Project 1",
      description: "This is the description for Project 1.",
      githubLink: "https://github.com/",
      demoLink: "https://www.example.com/",
      image: "https://www.example.com/image1.jpg",
    },
    {
      title: "Project 2",
      description: "This is the description for Project 2.",
      githubLink: "https://github.com/",
      demoLink: "https://www.example.com/",
      image: "https://www.example.com/image2.jpg",
    },
    {
      title: "Project 3",
      description: "This is the description for Project 3.",
      githubLink: "https://github.com/",
      demoLink: "https://www.example.com/",
      image: "https://www.example.com/image3.jpg",
    },
  ];
  return(
    <div className="grid grid-cols-1 gap-6 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4">
    {projects.map((project, index) => (
      <div key={index} className="overflow-hidden rounded-lg shadow-lg">
        <img
          alt={project.title}
          className="object-cover w-full h-48"
          src={project.image}
        />
        <div className="px-6 py-4">
          <div className="mb-2 text-xl font-bold">{project.title}</div>
          <p className="text-gray-700 text-base">{project.description}</p>
        </div>
        <div className="flex items-center justify-between px-6 py-4">
          <a
            href={project.githubLink}
            target="_blank"
            rel="noopener noreferrer"
            className="text-white bg-gray-900 py-2 px-4 rounded hover:bg-gray-800"
          >
            GitHub
          </a>
          <a
            href={project.demoLink}
            target="_blank"
            rel="noopener noreferrer"
            className="text-white bg-blue-500 py-2 px-4 rounded hover:bg-blue-600"
          >
            Demo
          </a>
        </div>
      </div>
    ))}
  </div>
  )
}
